SET FOREIGN_KEY_CHECKS=0;

-- ----------------------------
-- Table structure for `region`
-- ----------------------------
DROP TABLE IF EXISTS `region`;
CREATE TABLE `region` (
  `id` varchar(255) NOT NULL COMMENT '主键',
  `code` varchar(32) NOT NULL COMMENT '地区编码',  
  `fullname` varchar(255) NOT NULL COMMENT '地区全称',
  `shortname` varchar(255) DEFAULT NULL COMMENT '地区简称',
  `level` int(11) NOT NULL COMMENT '地区级别   1:省份  2:城市  3:区县',
  `parent_code` varchar(32) DEFAULT NULL COMMENT '父地区编码',
  `sort` int(11) DEFAULT '0' COMMENT '排序',
  `spell_fullname` varchar(255) DEFAULT NULL COMMENT '拼音全拼',
  `spell_abbreviation` varchar(32) DEFAULT NULL COMMENT '拼音缩写',
  `spell_first_character` varchar(1) DEFAULT NULL COMMENT '拼音首字母',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  primary key(id),
  KEY UK_REGION_CODE (code)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='地区表';

